// Funcion que carga los objetos mapeados segun cambio de dimension
function cargarMapeadosDimension(dimension) {
    if (typeof dimension !== "number") return;
    if (typeof mapeadosDimension === undefined) return;
    if (mapeadosDimension.length <= 0) return;

    for (let i = 0, n = mapeadosDimension.length; i < n; i++) {
        let objMapeado = mapeadosDimension[i];

        // Al cambiar de dimension siempre borramos estos objetos
        if (objMapeado.objeto != null && mp.objects.exists(objMapeado.objeto)) {
            objMapeado.objeto.destroy();
            objMapeado.objeto = null;
        }

        // Solo creamos si es necesario crear en esta dimension
        if (objMapeado.excluye == true) {
            if (objMapeado.dimension != dimension) {
                // Objetos que estan en todas las dimensiones excepto la especificada
                objMapeado.objeto = mp.objects.new(objMapeado.hash, objMapeado.posicion, { rotation: objMapeado.rotacion, alpha: 255, dimension: dimension });
            }
        }
        else {
            if (objMapeado.dimension == dimension) {
                // Objetos que estan solo en la dimension especificada
                objMapeado.objeto = mp.objects.new(objMapeado.hash, objMapeado.posicion, { rotation: objMapeado.rotacion, alpha: 255, dimension: dimension });
            }
        }
    }
}

